import React from 'react'
import Power from '../components/Power'

const House = () => {
    return (
        <div
            style={{
                display: 'flex',
                justifyContent: 'space-around',
                alignItems: 'center'
            }}
        >
            <div>
                <Power />
            </div>
            <div>2</div>
        </div>
    )
}

export default House
